const ACTIONS = {
    R_START_RECORDING : "Tap in to Search component",

    
}
export {ACTIONS as RECORDER_ACTIONS};

export function startRecording(setName){
    return {
        type: ACTIONS.R_START_RECORDING,
        setName
    }
}
